import React from 'react';
import TF from './../tficon.svg';
import Keras from './../kerasicon.svg';

const Skills = () => {
	return(
		<div className='ph5'>
			<div className='pa3 tc'>
				<h1>Skills</h1>
			</div>
				<i className="devicon-python-plain-wordmark colored" style={{'font-size':'5em'}}></i>
				<h4>Python</h4>
				<img src={TF} alt='tf' style={{'width':'5em'}}/>
				<img src={Keras} alt='keras' style={{'width':'5em'}}/>
			<div>
			</div>
		</div>

	);
}

export default Skills;
